import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */
import { Container, Col, Row } from 'reactstrap'
import { FaGithub } from 'react-icons/fa'
import model from '../assets/img/model_sketch.svg'
import unibas_logo from '../assets/img/unibas.svg'
import seasonalIllustration from '../assets/img/seasonal_illustration.svg'
import LinkExternal from '../components/Router/LinkExternal'

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">




    <Container mdxType="Container">
      <Row mdxType="Row">
        <Col mdxType="Col">
          <h1>About COVID-19 Scenarios</h1>
          <p>{`This web application serves as a planning tool for COVID-19 outbreaks in communities across the world.
It implements a simple SIR (Susceptible-Infected-Recovered) model with additional categories for individuals exposed to the virus that are not yet infectious,
severely sick people in need of hospitalization, people in critical condition, and a fatal category.`}</p>
          <p>{`The source code of this tool is freely available at `}<LinkExternal url="https://github.com/neherlab/covid19_scenarios" mdxType="LinkExternal">{`github.com/neherlab/covid19_scenarios`}</LinkExternal>{` and we welcome contributions in any form: comments, suggestions, help with development. Join our `}<LinkExternal url="https://github.com/neherlab/covid19_scenarios/discussions" mdxType="LinkExternal">{`General Discussion Thread`}</LinkExternal>{`.
A preprint describing covid19-scenarios.org is now available on `}<LinkExternal url="https://www.medrxiv.org/content/10.1101/2020.05.05.20091363v2" mdxType="LinkExternal">{`medrxiv (doi: 10.1101/2020.05.05.20091363v2)`}</LinkExternal>{`.`}</p>
          <h2>{`Basic assumptions`}</h2>
          <p>{`The model works as follows:`}</p>
          <ul>
            <li parentName="ul">
              <p parentName="li">{`susceptible individuals are exposed/infected through contact with infectious individuals. Each infectious individual causes on average `}<span parentName="p" {...{
                  "className": "math math-inline"
                }}><span parentName="span" {...{
                    "className": "katex"
                  }}><span parentName="span" {...{
                      "className": "katex-mathml"
                    }}><math parentName="span" {...{
                        "xmlns": "http://www.w3.org/1998/Math/MathML"
                      }}><semantics parentName="math"><mrow parentName="semantics"><msub parentName="mrow"><mi parentName="msub">{`R`}</mi><mn parentName="msub">{`0`}</mn></msub></mrow><annotation parentName="semantics" {...{
                            "encoding": "application/x-tex"
                          }}>{`R_0`}</annotation></semantics></math></span><span parentName="span" {...{
                      "className": "katex-html",
                      "aria-hidden": "true"
                    }}><span parentName="span" {...{
                        "className": "base"
                      }}><span parentName="span" {...{
                          "className": "strut",
                          "style": {
                            "height": "0.83333em",
                            "verticalAlign": "-0.15em"
                          }
                        }}></span><span parentName="span" {...{
                          "className": "mord"
                        }}><span parentName="span" {...{
                            "className": "mord mathdefault",
                            "style": {
                              "marginRight": "0.00773em"
                            }
                          }}>{`R`}</span><span parentName="span" {...{
                            "className": "msupsub"
                          }}><span parentName="span" {...{
                              "className": "vlist-t vlist-t2"
                            }}><span parentName="span" {...{
                                "className": "vlist-r"
                              }}><span parentName="span" {...{
                                  "className": "vlist",
                                  "style": {
                                    "height": "0.30110799999999993em"
                                  }
                                }}><span parentName="span" {...{
                                    "style": {
                                      "top": "-2.5500000000000003em",
                                      "marginLeft": "-0.00773em",
                                      "marginRight": "0.05em"
                                    }
