            <li parentName="ul">
              <p parentName="li">{`infectious individuals recover or progress to severe disease. The ratio of recovery to severe progression depends on age`}</p>
            </li>
            <li parentName="ul">
              <p parentName="li">{`severely sick individuals either recover or deteriorate and turn critical. Again, this depends on the age`}</p>
            </li>
            <li parentName="ul">
              <p parentName="li">{`critically ill individuals either get admitted to ICU (if space is available), or are placed in an overflow compartment. Younger age-groups are given preferential access to ICU.`}</p>
