          <p>{`COVID-19 is much more severe in the elderly and proportion of elderly in a community is therefore an important determinant of the overall burden on the health care system and the death toll. We collected age distributions for many countries from data provided by the UN and make those available as input parameters. Furthermore, we use data provided by the epidemiology group by the `}<LinkExternal url="http://weekly.chinacdc.cn/en/article/id/e53946e2-c6c4-41e9-9a9b-fea8db1a8f51" mdxType="LinkExternal">{`Chinese CDC`}</LinkExternal>{` (`}<LinkExternal url="https://web.archive.org/web/20200320025420/weekly.chinacdc.cn/en/article/id/e53946e2-c6c4-41e9-9a9b-fea8db1a8f51" mdxType="LinkExternal">{`alternative link`}</LinkExternal>{`) to estimate the fraction of severe and fatal cases by age group.`}</p>
          <h2>{`Seasonality`}</h2>
          <p>{`Many respiratory viruses such as influenza, common cold viruses (including other coronaviruses) have a pronounced seasonal variation in incidence which is in part driven by climate variation through the year. We model this seasonal variation using a sinusoidal function with an annual period. This is a simplistic way to capture seasonality. Furthermore, we don't know yet how seasonality will affect COVID-19 transmission.`}</p>
          <figure className="figure w-100 text-center">
  <img src={seasonalIllustration} className="w-75 figure-img img-fluid" alt="illustration of seasonal variation in transmission rate" />
  <figcaption className="figure-caption text-center">
    Figure 2. Seasonal variation in transmission rate is modeled by a cosine. The model allows to specify the
    average R0, the amplitude of the cosine (seasonal forcing), and the month of peak transmission.
  </figcaption>
          </figure>
