          <h2>{`Parameter estimation`}</h2>
          <p>{`With the prevalence of COVID-19 data for many regions, we now estimate a `}<em parentName="p">{`few`}</em>{` select parameters for independent regions that provide public data.
Specifically, we estimate the following default scenario parameters:`}</p>
          <ul>
            <li parentName="ul">{`R0 value`}</li>
            <li parentName="ul">{`The date and initial size of the epidemic start`}</li>
            <li parentName="ul">{`Fraction of cases caught by the region's testing infrastructure`}</li>
          </ul>
          <p>{`These parameters are estimated from both the cumulative number of COVID-19 cases and COVID-19 related fatalies reported.
The estimation is accomplished by the minimization of the least squared difference between our model predictions and the empirical data.
Specifically`}</p>
          <ul>
            <li parentName="ul">{`We define an objective function that:`}<ul parentName="li">
                <li parentName="ul">{`Takes as input a set of model parameters to simulate.`}</li>
                <li parentName="ul">{`Integrates the equations of motion described above.`}</li>
                <li parentName="ul">{`Returns the sum of squared residuals between the given empirical data and the result of ODE integration.`}</li>
                <li parentName="ul">{`The residuals to the cumulative fatalities are weighted relative to case data to account for the difference in magnitudes.`}</li>
              </ul></li>
            <li parentName="ul">{`The objective function is minimized with respect to the above variable parameters using the Nelder Mead algorithm.`}</li>
            <li parentName="ul">{`Scenarios are populated with these individualized parameters`}</li>
          </ul>
